import React, { Component } from 'react'
import { Dimensions, ImageBackground, StyleSheet, Text, View } from 'react-native'
import Swiper from 'react-native-swiper'

const styles = StyleSheet.create({
  slide: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  text: {
    color: '#fff',
    fontSize: 30,
    fontWeight: 'bold'
  }
})

export default class SignInScreen extends Component {
  constructor(props) {
    super(props);
    this.state = {
      height: null,
      width: null,
    };
  }

  componentWillMount() {
    //swap screen height and width after rotation
    let { height, width } = Dimensions.get('window');
    this.setState({
      width: parseInt(height),
      height: parseInt(width)
    })
  }

  render() {

    console.log(this.state.height, this.state.width)
    return (

      <View style={{
        height: this.state.height,
        width: this.state.width,
        translateX: -this.state.width / 2,
        translateY: -this.state.height / 2,
        // transform: [{ rotate: '90deg' }],
        top: this.state.width / 2,
        left: this.state.height / 2,
      }}>

        <Swiper showsButtons={true}>
          <ImageBackground source={{uri:'data:image/jpeg;base64,'}}
            resizeMode="contain"
            style={{ ...styles.slide, width: '100%', height: '100%' }}>
            <Text style={styles.text}>Hello Swiper</Text>
          </ImageBackground>
          <ImageBackground source={{uri:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTx8iR6WshPDT3BzhBSzZJtudTqGrjaf5pN_t9W4EyYIYUDWw5i&s'}}
            resizeMode='stretch'
            style={{ ...styles.slide, width: '100%', height: '100%' }}>
            <Text style={styles.text}>Beautiful</Text>
          </ImageBackground>
          <ImageBackground source={{uri:'data:image/jpeg;base64,'}}
            resizeMode='stretch'
            style={{ ...styles.slide, width: '100%', height: '100%' }}>
            <Text style={styles.text}>And Simple</Text>
          </ImageBackground>
        </Swiper>
      </View>
    )
  }
}